import React from 'react'

function Header(props) {
    return (
        <header>
            <h1>Sunny Gang Game</h1>
            <h1>Score: {props.score}</h1> | 
            <h1>Streak: {props.streak}</h1>
        </header>
    )
}
export default Header;
